import '../style/header.css';
import Shopping from './Shopping';
import { Routes, Route, Link } from "react-router-dom";
import React from 'react';

const Header = () => {
	return (
		<header className="header fixed-header">
			<nav className="navbar">
				<div className="logo">
					<img src="https://o.remove.bg/downloads/69a8237d-9433-4795-bca2-d2b03cffa775/image-removebg-preview.png" height="40px"></img>&nbsp;&nbsp;&nbsp;
				</div>
				<div className="menu">
					<ul>
						<li>
							<Link to="/">Trang chu</Link>
						</li>
						<li>
							<Link to="/admin">Trang Admin</Link>
						</li>
						<li>
							<Link to="/login">Đăng Nhập</Link>
						</li>
						<li>
							<Link to="/Shopping"><img src="https://o.remove.bg/downloads/0f25a9ac-51df-4ae8-9ad1-18fea5bfd674/image-removebg-preview.png" height="40px"></img></Link>
						</li>
					</ul>
				</div>
			</nav>
		</header>
	);
};

export default Header;
